import React from 'react';
import Clock from 'react-live-clock';

export default function LiveClock() {
  return (
    <p>
      Today is <Clock format={'dddd, do [of] MMMM HH:mm:ss'} ticking={true}/>, what are you up to?
    </p>
  )
}
